import { motion } from "framer-motion";

import './Collection.css';
import { Col, Container, Row } from "react-bootstrap";

import OneOfNine from './CollectionImages/1of9.png'
import TwoOfNine from './CollectionImages/2of9.png'
import ThreeOfNine from './CollectionImages/3of9.png'
import FourOfNine from './CollectionImages/4of9.png'
import FiveOfNine from './CollectionImages/5of9.png'
import SixOfNine from './CollectionImages/6of9.png'
import SevenOfNine from './CollectionImages/7of9.png'
import EightOfNine from './CollectionImages/8of9.png'
import NineOfNine from './CollectionImages/9of9.png'

function Collection(){

    const ArraysOfCollection = [{
        id: 1,
        image: OneOfNine,
        title: 'Moonbirds',
        text: 'Faucibus odio elementum nulla venenatis, libero. Ullamcorper duis fringilla pulvinar nibh diam sit.'
    },
    {
        id: 2,
        image: TwoOfNine,
        title: 'Clone X - X Takashi Murakami',
        text: 'Magna in condimentum praesent pretium vitae mattis facilisis nunc. Lectus in ac ac.'
    },
    {
        id: 3,
        image: ThreeOfNine,
        title: 'Mutant Ape Yacht Club',
        text: 'Sit aenean porttitor sit lectus. Adipiscing egestas etiam eget cursus nulla risus euismod. Netus.'
    },
    {
        id: 4,
        image: FourOfNine,
        title: 'MOAR" by Joan Cornella',
        text: 'Faucibus odio elementum nulla venenatis, libero. Ullamcorper duis fringilla pulvinar nibh diam sit.'
    },
    {
        id: 5,
        image: FiveOfNine,
        title: 'Doodles',
        text: 'Magna in condimentum praesent pretium vitae mattis facilisis nunc. Lectus in ac ac.'
    },
    {
        id: 6,
        image: SixOfNine,
        title: 'KIWAMI Genesis',
        text: 'Sit aenean porttitor sit lectus. Adipiscing egestas etiam eget cursus nulla risus euismod. Netus.'
    },
    {
        id: 7,
        image: SevenOfNine,
        title: 'Arcade Land',
        text: 'Faucibus odio elementum nulla venenatis, libero. Ullamcorper duis fringilla pulvinar nibh diam sit.'
    },
    {
        id: 8,
        image: EightOfNine,
        title: 'Goons of Balatroon',
        text: 'Magna in condimentum praesent pretium vitae mattis facilisis nunc. Lectus in ac ac.'
    },
    {
        id: 9,
        image: NineOfNine,
        title: 'Meta Toy DragonZ',
        text: 'Sit aenean porttitor sit lectus. Adipiscing egestas etiam eget cursus nulla risus euismod. Netus.'
    },
    
];
    const ArraysOfCollectionOnMap = ArraysOfCollection.map((ArrayOfCollection) =>
    
    <Col key = {ArrayOfCollection.id} lg = "4" md = "6">
        <img src = {ArrayOfCollection.image} className='w-100 border-rounded' />

        <div className = "text-center">
            <h1>{ArrayOfCollection.title}</h1>
            <p>{ArrayOfCollection.text}</p>
        </div>
    </Col>
);

    return(
        <Container className = "collection">
            
            <motion.div
            className="text-center collection"
            initial = {{opacity: 0}}
            transition={{duration: 1}}
            whileInView={{opacity: 1}}
            >
                <h1>Hottest Collections</h1>
                <p>Risus commodo id odio turpis pharetra elementum. Pulvinar porta porta feugiat scelerisque in elit. Morbi rhoncus, tellus, eros consequat magna semper orci a tincidunt. </p>
            </motion.div>

            <Row>
                {ArraysOfCollectionOnMap}
            </Row>
        </Container>
    )
}

export default Collection
